namespace SharpLearning.DecisionTrees.Test.SplitSearchers
{
    [TestClass]
    public class LinearSplitSearcherTest
    {
        [TestMethod]
        [ExpectedException(typeof(ArgumentException))]
        public void LinearSplitSearcher_MinimumSplitSize()
        {
            new LinearSplitSearcher(-1);
        }

        [TestMethod]
        public void LinearSplitSearcher_FindBestSplit()
        {
            var parser = new CsvParser(() => new StringReader(Resources.AptitudeData));
            var feature = parser.EnumerateRows("AptitudeTestScore").ToF64Vector();
            var targets = parser.EnumerateRows("Pass").ToF64Vector();
            var interval = Interval1D.Create(0, feature.Length);

            Array.Sort(feature, targets);

            var impurityCalculator = new GiniClassificationImpurityCalculator();
            impurityCalculator.Init(targets.Distinct().ToArray(), targets, new double[0], interval);
            var impurity = impurityCalculator.NodeImpurity();

            var sut = new LinearSplitSearcher(1);

            var actual = sut.FindBestSplit(impurityCalculator, feature, targets,
                interval, impurity);

            var expected = new SplitResult(15, 3.5, 0.037941545633853213,
                0.39111111111111119, 0.49586776859504134); 

            Assert.AreEqual(expected, actual);
        }

        [TestMethod]
        public void LinearSplitSearcher_FindBestSplit_Weight()
        {
            var parser = new CsvParser(() => new StringReader(Resources.AptitudeData));
            var feature = parser.EnumerateRows("AptitudeTestScore").ToF64Vector();
            var targets = parser.EnumerateRows("Pass").ToF64Vector();

            var interval = Interval1D.Create(0, feature.Length);
            var weights = targets.Select(v => Weight(v, 0.5)).ToArray();

            Array.Sort(feature, targets);

            var impurityCalculator = new GiniClassificationImpurityCalculator();
            impurityCalculator.Init(targets.Distinct().ToArray(), targets, weights, interval);
            var impurity = impurityCalculator.NodeImpurity();

            var sut = new LinearSplitSearcher(1);
            
            var actual = sut.FindBestSplit(impurityCalculator, feature, targets,
                interval, impurity);

            var expected = new SplitResult(15, 3.5, 0.045729402872260017,
                0.375, 0.49382716049382713); 

            Assert.AreEqual(expected, actual);
        }


        [TestMethod]
        public void LinearSplitSearcher_FindBestSplit_DecisionTreeData()
        {
            var parser = new CsvParser(() => new StringReader(Resources.DecisionTreeData));
            var feature = parser.EnumerateRows("F2").ToF64Vector();
            var targets = parser.EnumerateRows("T").ToF64Vector();
            var interval = Interval1D.Create(0, feature.Length);

            Array.Sort(feature, targets);

            var impurityCalculator = new RegressionImpurityCalculator();
            impurityCalculator.Init(targets.Distinct().ToArray(), targets, new double[0], interval);
            var impurity = impurityCalculator.NodeImpurity();

            var sut = new LinearSplitSearcher(1);

            var actual = sut.FindBestSplit(impurityCalculator, feature, targets,
                interval, impurity);

            var expected = new SplitResult(75, 0.397254, 309.6695422760252,
                0.30040476584587461, -9.0812926380897121); 

            Assert.AreEqual(expected, actual);
        }

